import React, { useState } from "react";
import { Container, Box, Typography, TextField, Button, Paper, Alert, Grid, Link } from "@mui/material";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import ReCAPTCHA from "react-google-recaptcha";

const RECAPTCHA_SITE_KEY = "6LfkPVErAAAAAKQktfpXosjg03RMBhzdytxLCZSu";

export default function RegisterPage() {
  const [form, setForm] = useState({
    nom: "",
    prenom: "",
    dateNaissance: "",
    email: "",
    cin: "",
    adresse: "",
    ville: "",
    codePostal: "",
    password: "",
    confirmPassword: ""
  });
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");
  const [recaptchaToken, setRecaptchaToken] = useState(null);
  const navigate = useNavigate();

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setSuccess("");
    if (!form.nom || !form.prenom || !form.dateNaissance || !form.email || !form.cin || !form.adresse || !form.ville || !form.codePostal || !form.password || !form.confirmPassword) {
      setError("Tous les champs sont obligatoires.");
      return;
    }
    if (!/^[^@\s]+@[^@\s]+\.[^@\s]+$/.test(form.email)) {
      setError("Adresse email invalide.");
      return;
    }
    if (!/^\d{10}$/.test(form.cin)) {
      setError("La pièce d'identité doit contenir exactement 10 chiffres.");
      return;
    }
    if (form.password.length < 6) {
      setError("Le mot de passe doit contenir au moins 6 caractères.");
      return;
    }
    if (form.password !== form.confirmPassword) {
      setError("Les mots de passe ne correspondent pas.");
      return;
    }
    if (!recaptchaToken) {
      setError("Veuillez valider le captcha.");
      return;
    }
    try {
      await axios.post("/api/auth/register", {
        username: form.email,
        password: form.password,
        nom: form.nom,
        prenom: form.prenom,
        dateNaissance: form.dateNaissance,
        cin: form.cin,
        adresse: form.adresse,
        ville: form.ville,
        codePostal: form.codePostal,
        recaptchaToken
      });
      setSuccess("Inscription réussie ! Vous pouvez vous connecter.");
      setTimeout(() => navigate("/login"), 1500);
    } catch (err) {
      setError(err.response?.data?.error || "Erreur lors de l'inscription");
    }
  };

  return (
    <Box sx={{ minHeight: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center', background: 'linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%)' }}>
      <Container maxWidth="xs">
        <Paper elevation={10} sx={{ p: 5, borderRadius: 5, boxShadow: 8, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <Box sx={{ mb: 2 }}>
            <img src="https://cdn.seedprod.com/wp-content/themes/seedprod-2021/assets/images/logo.svg" alt="Logo" style={{ width: 120 }} />
          </Box>
          <Typography variant="h5" align="center" gutterBottom sx={{ fontWeight: 700, color: 'primary.main' }}>
            Créer un compte
          </Typography>
          <Box component="form" onSubmit={handleSubmit} sx={{ width: '100%', mt: 2, display: 'flex', flexDirection: 'column', gap: 2 }}>
            <TextField label="Nom" name="nom" value={form.nom} onChange={handleChange} fullWidth required />
            <TextField label="Prénom" name="prenom" value={form.prenom} onChange={handleChange} fullWidth required />
            <TextField label="Date de naissance" name="dateNaissance" type="date" value={form.dateNaissance} onChange={handleChange} fullWidth required InputLabelProps={{ shrink: true }} />
            <TextField label="Adresse email" name="email" value={form.email} onChange={handleChange} fullWidth required type="email" />
            <TextField label="Pièce d'identité (10 chiffres)" name="cin" value={form.cin} onChange={handleChange} fullWidth required inputProps={{ maxLength: 10, pattern: "\\d*" }} />
            <TextField label="Adresse" name="adresse" value={form.adresse} onChange={handleChange} fullWidth required />
            <TextField label="Ville" name="ville" value={form.ville} onChange={handleChange} fullWidth required />
            <TextField label="Code postal" name="codePostal" value={form.codePostal} onChange={handleChange} fullWidth required />
            <TextField label="Mot de passe" name="password" type="password" value={form.password} onChange={handleChange} fullWidth required />
            <TextField label="Confirmer le mot de passe" name="confirmPassword" type="password" value={form.confirmPassword} onChange={handleChange} fullWidth required />
            <Box sx={{ display: 'flex', justifyContent: 'center', mt: 1 }}>
              <ReCAPTCHA sitekey={RECAPTCHA_SITE_KEY} onChange={token => setRecaptchaToken(token)} />
            </Box>
            <Button type="submit" variant="contained" color="primary" size="large" sx={{ mt: 2, fontWeight: 600, borderRadius: 2 }}>
              S'inscrire
            </Button>
          </Box>
          <Grid container justifyContent="center" sx={{ mt: 2, width: '100%' }}>
            <Grid item>
              <Link href="/login" underline="hover" color="primary">
                Déjà un compte ? Se connecter
              </Link>
            </Grid>
          </Grid>
          {error && <Alert severity="error" sx={{ mt: 2, width: '100%' }}>{error}</Alert>}
          {success && <Alert severity="success" sx={{ mt: 2, width: '100%' }}>{success}</Alert>}
        </Paper>
      </Container>
    </Box>
  );
}
